import React from "react";
import Chat from "./pages/Chat";
import { Routes, Route } from "react-router-dom";
import Loby from "./pages/loby";

function App() {
  return (
    <div className="App">
      <h1>hello</h1>
      <Routes>
        <Route path="/" element={<Loby />} />
        <Route path="/chat" element={<Chat />} />
      </Routes>
    </div>
  );
}

export default App;
